() => {
  let data = [];
  for (let i = 0; i < EMI_THREEM.data.length; i++) {
    if (EMI_THREEM.data[i].SEC_EMI_DATE >= DATE_FORMAT.get_today() || EMI_THREEM.data[i].THIRD_EMI_DATE >= DATE_FORMAT.get_today()) {
      data.push(EMI_THREEM.data[i]);
    }
  }
  return data;
}

